We developed ABA Mobile app for those who want to have around-the-clock access to their accounts on the go. You can check your balance instantly, pay bills quickly, open accounts easily, and get much more great features. It is free to download, secure and easy to use – so why not give it a try?

ADVANTAGES
With ABA mobile, you can:
- Check your balance and transactions history;
- Receive instant push notifications each time transaction is made;
- Open Fixed Deposit or Savings Account to reach your financial goals;
- Transfer money to any ABA account instantly;
- Send money to anyone and let them withdraw the cash from ABA ATM with a code, not a card;
- Issue Virtual card for safe online shopping;
- Pay bills (mobile, Internet, utilities, TV and others) without commission;
- Find nearest ABA branch, ATM or cash-in machine, and more. Watch the video to learn more: https://www.youtube.com/watch?v=4m-pa9u7sig.

HOW TO REGISTER
It is easy – if you already have an ABA card/account and registered mobile phone number with us, just download the app from your app store and follow the screen instructions to start banking with ABA. Watch our tutorial video on how to activate ABA Mobile here: https://www.youtube.com/watch?v=LcGksvu1xeo. You can also take your smartphone and visit the nearest ABA Bank branch to apply for the service.

SERVICE FEE
ABA Mobile app is FREE for all the basic features. We may impose charges for certain services of the app. Please ask our staff for more details.

SECURITY
We considered your convenience and security as our top priority while developing the application. We ensure you that no information on your transactions or accounts details is stored on your mobile device or SIM card. Therefore, even if your phone is lost or stolen, your bank account is absolutely safe and protected. At the same time, we cannot guarantee stable and safe operation of the application on a rooted or jail broken mobile device or with customized (modified) operating system.

IMPORTANT INFORMATION
The service is not applied to joint and corporate accounts. Terms and conditions are subject to change at the Bank's sole discretion without prior notice to customers. For more information, please visit your nearest ABA Bank branch, our website www.ababank.com or call our hotline at 023 225 333 available 24/7 for you.
